// HRMenu.js
import { Link } from 'react-router-dom';
import './hrmenu.css';

function HRMenuPage() {
  return (
    <div className="menu-container">
      <h2>HR Menu</h2>
      <div className="menu-options">
        <Link to="/contract" className="menu-option">Contract</Link>
        <Link to="/recommendations" className="menu-option">Provide Recommendations</Link>
        <Link to="/communications" className="menu-option">Communicate with Applicant</Link>
      </div>
    </div>
  );
}

export default HRMenuPage;
